def random_convex_polygon(n,rayd):
	random.seed(123)
	circle_r = rayd
	circle_x = 0
	circle_y = 0
	points = []
	for i in range(n):
		alpha = 2 * math.pi * random.random()
		#alpha = 2 * math.pi * random.uniform(0, 359)
		x = circle_r * math.cos(alpha) + circle_x
		y = circle_r * math.sin(alpha) + circle_y
		points.append([x,y])
	points = np.array(points)
	return points

